import React from 'react'
import {connect} from 'react-redux'

const CounterDown = (down) =>

    <button onClick={down}>
        Down
    </button>

const stmp = (state) => {}

const dtmp = (dispatch) => {
    return {
        down: () => {
            dispatch({type:"DOWN"})
        }
    }
}

export default connect(stmp,dtmp)(CounterDown)
